import './App.css';

function App() {
  return (
    <div className="App" >
       <form action="/" method="POST">

       <div class="input-group mb-3">
           <input type="text" class="form-control" name="question" placeholder="Ask a question" aria-describedby="button-addon2"/>
           <div class="input-group-append">
               <button class="btn btn-outline-secondary" type="submit">Ask</button>
           </div>
       </div>
   </form>
    </div>
  );
}

export default App;
